using Newtonsoft.Json;
using System.Net.Sockets;
using System.Security.Cryptography;
using System.Text;

namespace ConsoleTestLED
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Console.WriteLine("Hello, World!");

            

            // Send via TCP
            string server = "113.161.77.106";
            int port = 8888;

            while (true)
            {
                // base64 của ảnh logo công ty
                string logoBase64 = "data:image/png;base64,";
                //Information
                string plateNumber = "76D-797.79";
                string maLayNguyenCont1 = "MRSU6263232";
                string viTriLayNguyenCont1 = "DD-32-01-41";
                string maTraRongCont1 = "SKHU9501202";
                string viTriTraRongCont1 = "DG-02-02-11";
                string maLayNguyenCont2 = "HTSU6263231";
                string viTriLayNguyenCont2 = "AE-32-01-43";
                string maTraRongCont2 = "BEHU9501232";
                string viTriTraRongCont2 = "CN-02-02-41";

                // HTML template
                string html = $@"
                <div style='width:100%;height:100%;background-color:black; font-family:sans-serif; padding:10px; box-sizing:border-box;'>

                    <div style='display:flex; justify-content:space-between; align-items:center;'>
                        <div style='font-size:20px; color:white;'>{DateTime.Now:HH:mm:ss}</div>
                        <img src='{logoBase64}' style='width:30px; height:auto;' />
                    </div>

                    <div style='margin-top:1px; text-align:center; font-size:24px; color:white; font-weight:bold;'>
                        {plateNumber}
                    </div>

                    <div style='display:flex; justify-content:space-between; margin-top:1px;'>

                        <div style='width:50%; text-align:center;'>
                            <div style='font-size:10px; color:white;'>Lấy nguyên</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{maLayNguyenCont1}</div>
                            <div style='font-size:10px; color:white;'>Trả rỗng</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{maTraRongCont1}</div>
                            <div style='font-size:10px; color:white;'>Lấy nguyên</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{maLayNguyenCont2}</div>
                            <div style='font-size:10px; color:white;'>Trả rỗng</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{maTraRongCont2}</div>
                        </div>

                        <div style='width:50%; text-align:center;'>
                            <div style='font-size:10px; color:white;'>Vị trí</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{viTriLayNguyenCont1}</div>
                            <div style='font-size:10px; color:white;'>Vị trí</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{viTriTraRongCont1}</div>
                            <div style='font-size:10px; color:white;'>Vị trí</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{viTriLayNguyenCont2}</div>
                            <div style='font-size:10px; color:white;'>Vị trí</div>
                            <div style='font-size:12px; color:white; margin:0px 0;'>{viTriTraRongCont2}</div>
                        </div>

                    </div>

                </div>";
                var payload = new
                {
                    text = html,
                    sign = ComputeSHA256(html)
                };

                string json = JsonConvert.SerializeObject(payload);
                Console.WriteLine("Sending: " + json);

                try
                {
                    using TcpClient client = new TcpClient(server, port);
                    using NetworkStream stream = client.GetStream();
                    byte[] data = Encoding.UTF8.GetBytes(json + "\n");

                    // Send the JSON
                    stream.Write(data, 0, data.Length);
                    Console.WriteLine("Sent JSON to server.");

                    // Optional: Read response
                    byte[] buffer = new byte[4096];
                    int bytesRead = stream.Read(buffer, 0, buffer.Length);
                    string response = Encoding.UTF8.GetString(buffer, 0, bytesRead);
                    Console.WriteLine($"Received: {response}");
                    Thread.Sleep(1000);
                }
                catch (Exception ex)
                {
                    Console.WriteLine($"Error: {ex.Message}");
                }
            }

            Console.ReadLine();
        }
        static string ComputeSHA256(string input)
        {
            using var sha256 = SHA256.Create();
            byte[] bytes = Encoding.UTF8.GetBytes(input);
            byte[] hash = sha256.ComputeHash(bytes);
            return BitConverter.ToString(hash).Replace("-", "").ToLowerInvariant();
        }
    }
}
